import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import ProjectCard from "./ProjectCards";
import BlogCard from "./BlogsCards";
import Particle from "../Particle";

import arrhythmia from "../../Assets/Projects/arrhythmia.png";
import face from "../../Assets/Projects/face.png";
import covid from "../../Assets/Projects/Covid-19.png";
import ethereum from "../../Assets/Projects/ethereum.jpg";
import gameDev from "../../Assets/Projects/gameDev.jpg";
function Projects() {
	return (
		<Container fluid className="project-section">
			<Particle />
			<Container>
				<h1 className="project-heading">
					My Recent <strong className="purple">Works </strong>
				</h1>
				<p style={{ color: "white" }}>
					Here are a few projects I've worked on recently.
				</p>
				<Row
					style={{ justifyContent: "center", paddingBottom: "10px" }}
				>
					<Col md={4} className="project-card">
						<ProjectCard
							imgPath={arrhythmia}
							isBlog={false}
							title="Arrhythmia classification using CNN"
							description="Detection of different type of Arrhythmia by ECG Classification using Convolution Neural Network."
							link="https://github.com/Aryanodugoudar/Arrhythmia-Classification-Using-ECG"
						/>
					</Col>

					<Col md={4} className="project-card">
						<ProjectCard
							imgPath={githubFinder}
							isBlog={false}
							title="Face detection using opencv"
							description="A Web Application where the user can determine face using computer vision"
							link="https://github.com/Aryanodugoudar/face-recognition-web-app"
						/>
					</Col>

					<Col md={4} className="project-card">
						<ProjectCard
							imgPath={covid}
							isBlog={false}
							title="Covid-19 Stats"
							description="A simple Static Application with focus on UI where static data is displayed regarding covid-19. This applicaiton was built as a part of Computer Netowrks Course Assignment, Project was built using HTML,S(CSS),CSS-Grid"
							link="https://vikram-vinay-covid.netlify.app/"
						/>
					</Col>
				</Row>
				<h1 className="project-heading">
					My Recent <strong className="purple">Blog </strong> Posts
				</h1>
				<p style={{ color: "white" }}>
					Do give a read to some of my blogs
				</p>
				<Row style={{ justifyContent: "center" }}>
					<Col md={4} className="blog-card">
						<BlogCard
							imgPath={ethereum}
							link="https://medium.com"
							title="Building DApps"
							site="medium.com"
						/>
					</Col>
					<Col md={4} className="blog-card">
						<BlogCard
							imgPath={gameDev}
							link="https://medium.com"
							title="Rise Of Game Development in India"
							site="medium.com"
						/>
					</Col>
				</Row>
			</Container>
		</Container>
	);
}

export default Projects;
